// src/pages/Donate.js
import React from 'react';
import '../styles/Donate.css';

const Donate = () => {
  return (
    <div className="donate-container">
      <h1>Support Our Cause</h1>
      <p>Your contribution helps us make a difference in the communities we serve. We appreciate your generosity!</p>
      <div className="donation-options">
        <h2>How You Can Help</h2>
        <div className="donation-option">
          <h3>One-Time Donation</h3>
          <p>Make a single donation to support our current projects.</p>
          <button className="btn btn-primary">Donate Now</button>
        </div>
        <div className="donation-option">
          <h3>Monthly Subscription</h3>
          <p>Provide ongoing support with a monthly subscription.</p>
          <button className="btn btn-primary">Subscribe</button>
        </div>
        <div className="donation-option">
          <h3>Corporate Sponsorship</h3>
          <p>Partner with us for corporate sponsorship opportunities.</p>
          <button className="btn btn-primary">Inquire</button>
        </div>
      </div>
    </div>
  );
};

export default Donate;
